import React from 'react';

function Navbar(){
    return(
        <nav style={styles.navbar}>
            <h2 style={styles.navbarTitle}>Laptop Dünyası</h2>
            <ul style={styles.navbarMenu}>
                <li style={styles.navbarMenuItem}>Anasayfa</li>
                <li style={styles.navbarMenuItem}>Popüler Laptoplar</li>
                <li style={styles.navbarMenuItem}>Markalar</li>
            </ul>
        </nav>
    );
}

const styles = {
    navbar: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      backgroundColor: '#fff',
      padding: '1rem'
    },
    logo: {
      color: '#fff',
      margin: 0
    },
    menu: {
      listStyle: 'none',
      display: 'flex',
      gap: '1rem',
      margin: 0
    },
    link: {
      color: '#fff',
      textDecoration: 'none'
    }
  };
  
  export default Navbar;
